import React from "react";
import { useNavigate } from "react-router-dom";

const OutputDisplay = ({ url, result }) => {
  const navigate = useNavigate();

  const handleStoreOutput = async () => {
    try {
      const response = await fetch("http://localhost:5000/store", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ url, prediction: result }),
      });

      if (response.ok) {
        alert("Output stored successfully!");
      } else {
        alert("Failed to store output.");
      }
    } catch (error) {
      console.error("Error storing output:", error);
      alert("Error storing output.");
    }
  };

  return (
    <div style={{ textAlign: "center", padding: "20px", backgroundColor: "#eef5d7" }}>
      <h2>Detection Result</h2>
      <p><strong>URL:</strong> {url}</p>
      <p><strong>Prediction:</strong> {result}</p>
      
      <button onClick={handleStoreOutput} style={{ margin: "10px", padding: "10px" }}>
        Store Output
      </button>
      <button onClick={() => navigate("/")} style={{ padding: "10px" }}>
        Check Another URL
      </button>
    </div>
  );
};

export default OutputDisplay;
